pragma solidity ^0.4.17;

import "../base/owned.sol";
import "../base/mortal.sol";
import "./ITimelineLib.sol";
import "./timelineDocuments/TimelineDocument.sol";

/**
 * Base Contract for a TimeLine which is a cohesive linked list of documents that creates an
 * immutable and immortal history. The basic principles of a Timeline is that the data it stores can
 * never be altered but new timeline documents can be appended in order to build more history.
 *
 * NOTE: Remember to update upgradeable(version) in the declaration when creating a new version
 * of timeline
 *
 * Copyright (c) 2017 Cognate, Inc.
 */
contract Timeline is owned(msg.sender) {
    using ITimelineLib for *;

    ITimelineLib.TimelineStorage timeline;

    constructor(address previous) public {
        timeline._version = 3;
        timeline.init(Timeline(previous));
    }


    // calls ITimelineLib.append()
    function append(TimelineDocument document) public {
        timeline.append(document);
    }

    // calls ITimelineLib.appendBytes()
    function appendBytes(bytes documentCode) public {
        timeline.appendBytes(documentCode);
    }

    // calls ITimelineLib.remove()
    function remove(TimelineDocument document) public {
        timeline.remove(document);
    }

    // calls ITimelineLib.callFunctionOf()
    function callFunctionOf(address target, uint value, bytes funcData) public returns (bool) {
        return target.callFunctionOf(value, funcData);
    }

    // calls ITimelineLib.upgrade()
    function upgrade(Timeline to) public onlyOwner {
        transferOwnershipTo(to);
        timeline.upgrade(to);
    }

    // Getters
    //---------
    function version() public view returns (uint16) {
        return timeline._version;
    }

    function upgraded() public view returns (bool) {
        return timeline._upgraded;
    }

    function previous() public view returns (Timeline) {
        return timeline._previous;
    }

    function next() public view returns (TimelineDocument) {
        return timeline._next;
    }

    function tail() public view returns (TimelineDocument) {
        return timeline._tail;
    }
}
